import React, { Component } from 'react'
import Posts from '../posts/posts'

export class Home extends Component {
    

    render() {
        return (
            <div class="row">
                <Posts></Posts>
            <div class="col-8">col-8</div>
            <div class="col-4">col-4</div>
            </div>
        )
    }
}

export default Home
